import React from 'react'

import './Navbar.scss'

const Navbar = () => {
  return (
    <nav className='app__navbar'>
      <div className='app__navbar-logo'>
        <img src='' alt='Logo'/>
      </div>

      <ul className='app__navbar-links'>
        {['home', 'about', 'contact', 'work', 'skills'].map((item) => (
          <li key={`link-${item}`}>
            <div />
            <a href={`#${item}`}>{item}</a>
          </li>
        ) )}
      </ul>

    </nav>
    //<div>Navbar</div>
  )
}

export default Navbar
